// SPDX-License-Identifier: MIT
pragma solidity ^0.8.13;

import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/utils/Strings.sol";
import "hardhat/console.sol";
import "./EncNft.sol";

contract Marketplace is ReentrancyGuard {
    using SafeMath for uint256;
    using Counters for Counters.Counter;
    Counters.Counter private _nftsSold;
    Counters.Counter private _nftCount;
    uint256 public LISTING_FEE = 0.0001 ether;
    ENCNFT encNftContract;
    address payable private _marketOwner;
    mapping(uint256 => NFT) private _idToNFT;
    struct NFT {
        address nftContract;
        uint256 tokenId;
        address payable seller;
        address payable owner;
        uint256 price;
        bool listed;
    }
    event NFTListed(
        address nftContract,
        uint256 tokenId,
        address seller,
        address owner,
        uint256 price
    );
    event NFTSold(
        address nftContract,
        uint256 tokenId,
        address seller,
        address owner,
        uint256 price
    );

    struct BuyerData {
        address buyerAddress;
        string buyerPublicKey;
        uint256 buyerBet;
        string goalOfPurchase;
    }

    struct SellerData {
        address sellerAddress;
        uint256 deadline;
        uint256 sellerSum;
    }
    mapping(uint256 => BuyerData[]) public buyersBoard; // to do private
    mapping(uint256 => SellerData[]) public sellersBoard; // to do private

    event NewOwner(uint256 idToken, address buyerAddress);
    event TokenForSell(uint256 idToken, address buyerAddress, string message);
    event BuyerMadeBet(uint256 idToken, address buyerAddress, uint256 bet);
    event BuyerWithdrewBet(uint256 idToken, address buyerAddress, uint256 bet);
    event ValueReceived(address sender, uint256 value);
    event FeeReceived(uint256 feeValue, uint256 nftId);
    event sellerWithdrewSum(
        uint256 idToken,
        address sellerAddress,
        uint256 sum
    );

    constructor() {
